      <div className="container-center">
        <div className="intro-header px-4">
          <h1 className="display-4">Thanks for signing up!</h1>
          <p className="signup">You should receive a confirmation email within the next few minutes.</p>
        </div>
      </div>

      <style jsx>{`
        .p-signup {
          font-size: 18px;
        }

        .home {
          max-width: 500px;
        }
        `}
      </style>

    </Layout>
  )
}
